import React from "react";
import { Link } from "react-router-dom";
import "./css/mainNav.css";
import SocialMediaIcons from "./socialIcons";
import { Component } from "react";
import SmallNav from "./smallNav";

class MainNav extends Component {
  state = { classes: "p-5" };
  // scrollHandler = () => {
  //   if (window.scrollY > 24) {
  //     console.log();
  //     this.setState({ classes: "p-0" });
  //   }
  //   if (window.scrollY < 24) {
  //     this.setState({ classes: "p-5" });
  //   }
  // };

  render() {
    if (window.scrollY > 24) {
      console.log();
      this.setState({ classes: "p-0" });
    }
    if (window.scrollY < 24) {
      this.setState({ classes: "p-5" });
    }
    return (
      <nav className="navbar navbar-expand-md bg-dark p-2 sticky-top">
        <div className="container-fluid">
          <Link
            to=""
            className={`navbar-brand text-white mx-auto ${this.state.classes}`}
          >
            <img src="" alt="OY Technology Pvt. Ltd." />
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon p-0 fw-bold">
              <SocialMediaIcons sMedia="list" />
            </span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav mx-sm-auto text-center pr-5 pr-md-0">
              <li className="nav-item">
                <Link to="" className="nav-link text-white links">
                  Home
                </Link>
              </li>
              <li className="nav-item">
                <Link to="" className="nav-link text-white links">
                  About Us
                </Link>
              </li>
              <li className="nav-item dropdown">
                <Link
                  to=""
                  className="nav-link text-white links dropdown-toggle"
                  id="navbarDropdown"
                  role="button"
                  data-bs-toggle="dropdown"
                  aria-expanded="false"
                >
                  Services
                </Link>
                <ul
                  className="dropdown-menu bg-dark p-0 text-center"
                  aria-labelledby="navbarDropdown"
                >
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      Service 01
                    </Link>
                  </li>
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      Service 02
                    </Link>
                  </li>
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      Service 03
                    </Link>
                  </li>
                </ul>
              </li>
              <li className="nav-item">
                <Link to="" className="nav-link text-white links">
                  Career
                </Link>
              </li>

              <li className="nav-item dropdown">
                <Link
                  to=""
                  className="nav-link text-white links dropdown-toggle"
                  id="navbarDropdown"
                  role="button"
                  data-bs-toggle="dropdown"
                  aria-expanded="false"
                >
                  Pages
                </Link>
                <ul
                  className="dropdown-menu bg-dark p-0 text-center"
                  aria-labelledby="navbarDropdown"
                >
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      Clients
                    </Link>
                  </li>
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      Portfolio
                    </Link>
                  </li>
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      FAQs
                    </Link>
                  </li>
                  <li>
                    <Link to="" className="dropdown-item text-white links">
                      Mart
                    </Link>
                  </li>
                </ul>
              </li>
              <li className="nav-item">
                <Link to="" className="nav-link text-white links">
                  Blogs
                </Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    );
  }
}

export default MainNav;

